class GithubPagesJokesJsonapi{constructor(){this.data=null}async init(){this.data=await this.getData()}async getData(){let t=await fetch("https://www.luigic.es/GithubPages-Jokes-JsonAPI/JsonAPI/dataES.json");return t.json()}getRandomInt(t){return Math.floor(Math.random()*t)}getRandomObjKey(t){var e=Object.keys(t);return t[e[e.length*Math.random()<<0]]}getJoke(){let t=this.data.chistes[this.getRandomInt(this.data.chistes.length)];return t}getJokeAsText(){return this.getJoke().sentence}getRandomText(){let t=this.getRandomObjKey(this.data),e=t[this.getRandomInt(t.length)];return e.sentence}getRandom(){let t=this.getRandomObjKey(this.data),e=t[this.getRandomInt(t.length)];return e}getRandomFamilyFriendlyText(){let t=null;for(;null==t||null!=t&&0!=t.tags.length;)t=this.getRandom();return t.sentence}}
